import React from 'react';

const AboutUs = () => {
  return (
    <section className="about-us-section">
      <div className="overlay">
        <h1 className="section-title">About Us</h1>
        <p className="section-description">
          At <span className="company-name">Mysore Motors</span>, we specialize in providing high-quality vehicle parts and mechanical components. 
          With a passion for precision and reliability, we serve the automotive industry with cutting-edge solutions to ensure top-notch performance and durability. 
        </p>
      </div>
    </section>
  );
};

export default AboutUs;
